import React, { useState } from "react";
import ContainedButtons from "./Button";
import CustomizedInputs from "./Input";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles(() => ({
  input: {
    margin: "10px auto",
    paddingTop: "150px",
    paddingLeft: "100px",
  },
  button: {
    margin: "10px auto",
    paddingLeft: "100px",
  },
}));

function Form() {
  const classes = useStyles();

  const [locdata, setlocdata] = useState();

  const handelurduc = ({ target }) => {
    setlocdata(target.value);
  };

  const findebus = () => {
    alert(locdata);
  };

  return (
    <>
      <Grid container>
        <Grid container item xs={12} spacing={3} className={classes.input}>
          <CustomizedInputs handelurduc={handelurduc}></CustomizedInputs>
        </Grid>
        <Grid container item xs={12} spacing={3} className={classes.button}>
          <ContainedButtons findebus={findebus}></ContainedButtons>
        </Grid>
      </Grid>
    </>
  );
}

export default Form;
